{"filter":false,"title":"latihan_module.py","tooltip":"/latihan_module.py","undoManager":{"mark":0,"position":0,"stack":[[{"start":{"row":0,"column":0},"end":{"row":27,"column":26},"action":"insert","lines":["import jsonFileHandler","","data = jsonFileHandler.readJsonFileZauvik(\"insulin.json\")","# print(data)","","if(data != \"\"):","    bInsulin = data['molecules']['bInsulin']","    aInsulin = data['molecules']['aInsulin']","    insulin = bInsulin + aInsulin","    molecularWeightInsulinActual = data['molecularWeightInsulinActual']","    print('bInsulin: ' + bInsulin)","    print('aInsulin: ' + aInsulin)","    print('molecularWeightInsulinActual: ' + str(molecularWeightInsulinActual))","    ","    # Calculating the molecular weight of insulin  ","    # Getting a list of the amino acid (AA) weights  ","    aaWeights = data['weights']","    # Count the number of each amino acids  ","    aaCountInsulin = ({x: float(insulin.upper().count(x)) for x in ['A','C','D', 'E', 'F', 'G', 'H', 'I', 'K', 'L', 'M', 'N', 'P', 'Q', 'R','S', 'T','V', 'W', 'Y']})  ","    # Multiply the count by the weights  ","    molecularWeightInsulin = sum({x: (aaCountInsulin[x]*aaWeights[x]) for x in","    ['A', 'C', 'D', 'E', 'F', 'G', 'H', 'I', 'K', 'L', 'M', 'N', 'P', 'Q', 'R','S', 'T', 'V', 'W', 'Y']}.values())  ","    print(\"The rough molecular weight of insulin: \" +","    str(molecularWeightInsulin))","    print(\"Percent error: \" + str(((molecularWeightInsulin - molecularWeightInsulinActual)/molecularWeightInsulinActual)*100))","    ","else:","    print(\"data is empty\")"],"id":1}]]},"ace":{"folds":[],"scrolltop":218,"scrollleft":0,"selection":{"start":{"row":7,"column":44},"end":{"row":7,"column":44},"isBackwards":false},"options":{"guessTabSize":true,"useWrapMode":false,"wrapToView":true},"firstLineState":0},"timestamp":1756177123987,"hash":"5e953f56852045a0e57c358350f8516d1ec2c363"}